import React from "react";
import '../index.css';

function TableItem({year,totalSavings, yearlyInterest, totalInterest, yearlyContibution}) {
    
    totalIntetotalInterest = (year > 1) ? totalInterest : yearlyInterest; 
    
    return (
        <tr>
        <td>{year}</td>
        <td>${totalSavings}</td>
        <td>${yearlyInterest}</td>
        <td>${totalSavings-yearlyContibution}</td>
        <td>${yearlyContibution}</td>
        </tr>
    )
}

export default TableItem;
